    false,nt"url": null,nt"notes": "This annual narrative report for Amagansett
    National Wildlife Refuge outlines Refuge accomplishments during the 1972 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, furbearers, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, fishing, and violations. Items of interest, N-R forms, and
    photographs are included.",nt"license_title": "License Not Specified",nt"extras":
